CREATE TABLE `game_info_table` (
  `game_name` varchar(60) NOT NULL,
  `game_publisher` varchar(60) NOT NULL,
  `development_studio` varchar(60) NOT NULL,
  `publication_date` date NOT NULL,
  `age_appropriation` int(11) NOT NULL,
  `total_rating` int(11) NOT NULL,
  `total_reviews` int(11) NOT NULL,
  `image` mediumblob NOT NULL,
  `singleplayer` tinyint(1) NOT NULL,
  `multiplayer` tinyint(1) NOT NULL,
  `genre1` varchar(20) DEFAULT NULL,
  `genre2` varchar(20) DEFAULT NULL,
  `genre3` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`game_name`),
  UNIQUE KEY `game_name_UNIQUE` (`game_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
